    <div class="container h-100">
      <div class="row h-100 align-items-center justify-content-center text-center">
        <div class="col-lg-10 align-self-end">
          <h1 class="text-uppercase text-white font-weight-bold">Welcome to Radio Emas</h1>
          <hr class="divider my-4">
        </div>
        <div class="col-lg-8 align-self-baseline">
          <p class="text-white-75 font-weight-light mb-5">Radio Emas aims to be
            the constant companion to Malaysian senior citizens, to help them
            resume life after retirement on a positive note. Senior citizens
            have a wealth of knowledge and experience, through which they are
            able to continue contributing to society and the nation. The programs
            on Radio Emas are designed to provide you a platform for such input,
            apart from providing you the opportunity to entertain fellow senior
            citizens, or be entertained!</p>
