          <div class="col-lg-8 text-center">
            <h2 class="text-white mt-0">Kami mempunyai apa yang anda perlukan!</h2>
            <hr class="divider light my-4">
            <p class="text-white-50 mb-4">Radio Emas berhasrat mengisi apa-apa
              kekosongan Wargamas Malaysia agar bersemangat memulakan semula kehidupan
              selepas bersara. Kami  yakin ada Kegembiraan & Kepuasan Selepas Bersara.
              Seperti disarankan oleh Kerajaan, Wargamas masih mampu  menyumbang kepada masyarakat
              dan negara bila berkongsi  pengalaman dan kepakaran masing-masing.Rancangan-rancangan
              Radio Emas menyediakan peluang yang luas untuk menyerlahkan sumbangan anda di samping
              memberi peluang kepada anda menghibur atau di hiburkan! Jom ambil bahagian!</p>
